const Header = () => {
  const [networkButton, setNetworkButton] = useState(null);
  const online = Useonlinestatus(); // Assuming this is a custom hook to detect online status
  const statuscheck = () => {
    online ? setNetworkButton("✅") : setNetworkButton("❌");
  };

  useEffect(() => {
    statuscheck();
  }, [online]);

  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    const userData = localStorage.getItem("userlogindata");
    if (userData) {
      setIsLoggedIn(true);
    } else {
      setIsLoggedIn(false);
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("userlogindata");
    setIsLoggedIn(false);
  };

  const handleLogin = () => {
    localStorage.setItem("userlogindata", "someUserData"); // Replace "someUserData" with actual user data
    setIsLoggedIn(true);
  };

  const cartItems = useSelector((store) => store.cart.items);

  return (
    <div className="header">
      <div className="image-container">
        <a href="/">
          <img className="logoimg" alt="logo" src={MAIN_LOGO}></img>
        </a>
      </div>
      <div className="nav-items">
        <ul>
          <li>
            <h4 className="pagebutton">{networkButton}</h4>
          </li>
          <li>
            <Link to="/" className="pagebutton">Home</Link>
          </li>
          <li>
            <Link to="/About" className="pagebutton">About</Link>
          </li>
          <li>
            <Link to="/Contact" className="pagebutton">Contact</Link>
          </li>
          <li>
            <Link to="/Cart" className="pagebutton">🛒 ({cartItems.length})</Link>
          </li>
          <li>
            <Link to="/Login" className="pagebutton">
              {isLoggedIn ? (
                <button className="login-button" onClick={handleLogout}>Logout</button>
              ) : (
                <button className="login-button" onClick={handleLogin}>Login</button>
              )}
            </Link>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Header;
